script: |
  super -f text -I q2549.spq | sort > q2549.out

inputs:
  - name: q2549.spq
    data: |
      SELECT + col0 * 59 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - CAST ( + col2 AS INTEGER ) * CAST ( col2 + + 25 * col0 AS INTEGER ) - + 59 AND + col0;
  - name: tab1

outputs:
  - name: q2549.out
    data: |
